# create node class
class BNode:
  def __init__(self, name, parents, prob):
    self.name = name # name of Node (ex. 'B','E','A','J','M')
    # added children because it is necessary for markov blankets
    self.children = None
    self.parents=parents # parents of node (ex. parents of 'A' are ['B','E'])
    self.prob=prob # Provided probabilities that correspond with node
  

  def probs(self, tf, e): # given bool and evidence, calculates probabilities
    if self.parents is None: # if no parents
      probs=self.prob[''] # extract probability
    elif len(self.parents)==1: # if one parent
      probs=self.prob[e[self.parents[0].name]] # extract probability
    elif len(self.parents)>1: # if more than one parent
      p=[]
      for parent in self.parents: # for all parents
        if parent.name in e: # if parent in provided evidence
          p.append(e[parent.name]) # create list for tuple 
      probs=self.prob[tuple(p)] # extract probabilities
    if not tf: # if False
      return (1-probs) # probability will be 1-probs
    else: # if True
        return probs # returns probs
# create bayes net class
class BNet:
  def __init__(self, networkname): #, node_s=None): 
    self.name = networkname
    self.nodes = []
    self.nodenames=[] 
  def __repr__(self):
    n_name = str(self.name)
    return n_name
  def add_node(self, node): # adds nodes to the net input would be BNode(name, parents, prob)
    if node.parents is None: # if doesn't have parents
      self.nodes.append(node) # add node to nodes
      self.nodenames.append(node.name) # add node name to nodenames
    else: # if does have parents
      for parent in node.parents: # for each parent
        if parent not in self.nodes: # if not already in nodenames
          return # return because parent needs to be added first
      self.nodes.append(node) # add node to nodes
      self.nodenames.append(node.name) # add node name to nodenames


