def enumeration_ask(X, tf, e, bn): 
  """
  Inputs:
  X: Query variable
  tf: Boolean value for Query variable
  e: observed/evidence values for query variable
  bn: Bayesnet
  """
  QX = {} # distribution over x
  for b in [True, False]: # go through T and F so that we obtain all values for QX
    ec = e.copy() # make copy of observed values
    ec.update({X: b}) # update query variable to be b
    QX[b] = enumerate_all(bn.nodes, ec) # call enumerate_all on nodes and copy of observed values
  normalize=QX[tf]/sum(QX.values()) # normalize by dividing the value of QX we want (tf) over all QX values
  return normalize # return the normalized probability

def enumerate_all(vars,e):
  if len(vars)!=0: # if variables
    value=vars[0] # start on first
    for b in [True, False]: # go through T and F
      if value.name in e and (b==e[value.name]): # if name in observed values and b is the right bool
        calculate=value.probs(b,e)*enumerate_all(vars[1:],e) # recursively call and multiply probabilities
        return calculate # return calculated probability to be normalized 
    else: 
        _sum=0 # initialize
        for b2 in [True, False]: 
          ec=e.copy() # make a copy of observed values
          ec.update({value.name:b2}) # update to b2
          _sum+=value.probs(b2,ec)*enumerate_all(vars[1:],ec) # same as above
        return _sum # return the added probabilities
  else: # if no vars
    return 1

