def rejection_sampling(X,tf,e,bn,N):
  Xe={X:tf} # create dictionary entry for query variable and tf value entered
  C=[0]*N # to count number that match evidence and query
  N=[0]*N # to count number that match evidence
  counter=-1 
  for i in N:
    counter+=1
    x,ev=prior_sample(bn) # call prior sample function and store output
    if (all(key in ev and ev[key] == e[key] for key in e)): # if prior sample evidence matches query evidence
       N[counter]=N[counter]+1 
       if (all(key in ev and ev[key] == Xe[key] for key in Xe)): # if prior sample evidence matches query variable tf val
        C[counter]=C[counter]+1
  if sum(N)!=0: # Normalize
    Norm=sum(C)/sum(N)
  else:
    Norm=0
  return Norm

  
def prior_sample(bn): # takes the network, returns prior sample tf values and probabilities
  sample={}
  ev={}
  for node in bn.nodes:
    problist=[]
    prob=1
    if node.parents is None: # if no parents
      samp=rand([node.prob[''], (1-node.prob[''])]) #get probability
      prob=node.probs(samp, {'':True})
      ev[node.name]=samp # store in evidence
      sample[node.name]=prob # store in sample
    else:
      parent_specify={} # store parent value from sample
      pro=[] 
      for i in node.parents:
        parent_specify[i.name]=ev[i.name]
        pro.append(ev[i.name])
      if len(node.parents)>=2: # if two or more parents
        samp=rand([node.prob[(tuple(pro))], (1-node.prob[(tuple(pro))])])
        prob=node.probs(samp,parent_specify)
        ev[node.name]=samp
      else: # if one parent 
        samp=rand([node.prob[(pro[0])], (1-node.prob[pro[0]])])
        prob=node.probs(samp,parent_specify)
        ev[node.name]=samp
    problist.append(prob)
    sample[node.name]=prob 
  return sample,ev # returns the sample true/false values and the probabilities

def rand(weights): # returns random choice True/False based on the probabilities from variables
  return np.random.choice([True, False],1, p=weights)[0]

