def markov_blanket(Zi, bn, x, TF_given):
# return multiplied probabilities, P(Zi|parents)*P(each child|parents)
  prob_list = []
  par_list = Zi.parents
  child_list = Zi.children
  x[Zi] = TF_given

  # add all P(Zi|parent) to the probability list
  if par_list == None:
      # Zi_prob = enumeration_ask(Zi.name, x[Zi], {'':True}, bn)
      Zi_prob = Zi.probs(x[Zi], {'':True})
      prob_list.append(Zi_prob)
  if par_list is not None:
    par_dict = {pnode.name: x[pnode] for pnode in par_list}
    # for key,value in par_dict.items():
    #   print(key, value)
    # Zi_prob = enumeration_ask(Zi.name, x[Zi], par_dict, bn)
    Zi_prob = Zi.probs(x[Zi], par_dict)
    prob_list.append(Zi_prob)
  
  
  c_p = []
  # add all P(child|Zi,other_parent) to the probability list
  if child_list is not None:
    for i in child_list:
      child_par = i.parents
      cp_dict = {pnode.name: x[pnode] for pnode in child_par}
      # for key,value in cp_dict.items():
      #   print(key, value)
      # Zi_prob = enumeration_ask(i.name, x[i], cp_dict, bn)
      Zi_prob = i.probs(x[i], cp_dict)
      prob_list.append(Zi_prob)

    # looking at the child-parents and their probability, excluding Zi because we've already calculated Zi|parents
    for cp in child_par:
      cp_par = cp.parents
      if cp != Zi:
        if cp_par == None:
          # Zi_prob = enumeration_ask(cp.name, x[cp], {'':True}, bn)
          Zi_prob = cp.probs(x[cp], {'':True})
          prob_list.append(Zi_prob)
        else:
          cpp_dict = {pnode.name: x[pnode] for pnode in cp_par}
          # Zi_prob = enumeration_ask(cp.name, x[cp], cpp_dict, bn)
          Zi_prob = cp.probs(x[cp], cpp_dict)
          prob_list.append(Zi_prob)


    
  # print(prob_list)
  # multiply all probabilities in probability list together
  net_prob = 1
  for n in prob_list:
    net_prob = net_prob * n
  
  return net_prob

# Get proportion of true/N samples for each variable in dict C
def normalize(C,N):
  norm = DefaultDict(int)
  for idx, value in C.items():
    numT = C[idx]
    norm[idx] = numT/N
  return norm

# normalize the true probability and false probability calculated in the markov blanket 
# and decide the value given to the variable
def TFnorm(Zi, x, Tprob, Fprob):
  if Tprob == 0 and Fprob == 0:
    x[Zi] == False
    return
  Tnorm = Tprob/(Tprob+Fprob)
  Fnorm = Fprob/(Tprob+Fprob)
  rand_draw = random.random()
  if Tnorm > Fnorm:
    if rand_draw < Tnorm:
      x[Zi] = True
    else:
      x[Zi] = False
  else:
    if rand_draw < Fnorm:
      x[Zi] = False
    else:
      x[Zi] = True

    
# e is a list of tuples (variable, t/f)
def gibbs_sampling(X, e, bn, N):
  # X: Query Variable Node
  # e: evidence node
  # bn: Bayes Network
  # N: number of samples

  # Z are non evidence variables
  Z = []
  for var in list(bn.nodes):
    if var not in e.keys():
      Z.append(var)
  # x is initialized with random values (true/false) for variables in Z and fixed e evidence variables
  x = {}
  C = DefaultDict(int)

  tfstate = [True, False]
  for var in Z:
    varstate = random.choice(tfstate)
    x[var] = varstate
    C[var] = 0

  for key, value in e.items():
    x[key] = value
    C[key] = 0
  
  # For N samples, check probability for all non-evidence variables and assign True/False.
  # Keep count of all True values for each variable.
  for i in range(N):
    for Zi in Z:
      Tprob = markov_blanket(Zi, bn, x, True)
      Fprob = markov_blanket(Zi, bn, x, False)
      TFnorm(Zi, x, Tprob, Fprob)
    #x[idx] = # val Zi from x by sampling P(Zi|mb(Zi)) - true/false
    # increase count
    # C[j] <- C[j]+1 where xj is the value of X in x
    # counting t/f for all X var and e var
      if x[Zi] == True:
        C[Zi]+=1

  # This print was used to check that the count dictionary count for True values for all variables.
  # print(C)
  # This returns the dictionary for all variable's probabilities rather than just the query variable.
  # It proved valuable for comparisons in testing.
  return normalize(C,N)

